INSERT INTO `solicitudes_actividades` VALUES (6,'2017-09-20 13:45:57',NULL,1,'Juan José ','Toledo Aral',NULL,'[\"PhD student\",\"PI\"]','juanjo@us.es',NULL,'Fisiología Médica y Biofísica','CTS-517','Facultad de Medicina/IBiS','Director de Departamento, Coordinador de Área en IBiS y miembro de la Comisión de Investigación. Trata con temas de ética científica.',NULL,NULL,NULL,NULL,NULL,NULL),(5,'2017-09-20 13:16:46',NULL,1,'Alberto','Pascual Bravo',NULL,'[\"PI\"]','apascual-ibis@us.es',NULL,'Instituto de Biomedicina de Sevilla (IBiS)','Mechanisms of neuronal maintenance','Hospital Universitario Virgen del Rocío/CSIC/Universidad de Sevilla','To learn about the responsibilities that we have as PIs regarding ethics in Science and how to establish good practices in the lab.',NULL,NULL,NULL,NULL,NULL,NULL),(7,'2017-09-21 10:07:04',NULL,1,'Yolanda María','Pacheco López',NULL,'[\"PI\"]','ypacheco-ibi@us.es',NULL,'Instituto de Biomedicina de Sevilla','Laboratorio de Inmunovirología','Hospital Universitario Virgen del Rocío','El tema me parece de gran interés',NULL,NULL,NULL,NULL,NULL,NULL),(8,'2017-09-21 13:58:38',NULL,1,'Sonia ','Pinela da Silva',NULL,'[\"Postdoc\"]','sonia.pinela@cabimer.es',NULL,'Genome Biology','Andres Aguilera','CABIMER','As a postdoc researcher, it is essential to be active and updated in the field of Research Integrity. The discussion of the major challenges and conduct in the field of scientific research nowadays are central to our work and to be able to produce significant and reliable data and publications, stimulate meaningful and positive scientific and social discussion. Theses are, in my view, imperative if we want to produce knowledge and be able to sustain research as an essential tool of progress in all fields being it environment, health, finance, socio-cultural. etc. ',NULL,NULL,NULL,NULL,NULL,NULL),(9,'2017-09-21 16:46:59',NULL,1,'LUCIA','ROMERO AZOGIL',NULL,'[\"PhD student\"]','lrazogil@us.es',NULL,'QUIMICA ORGANICA Y FARMACEUTICA','CARBOHIDRATOS Y POLIMEROS','FACULTAD DE FARMACIA','',NULL,NULL,NULL,NULL,NULL,NULL),(10,'2017-09-21 16:54:25',NULL,1,'Anabell ','Urbina Salazar ',NULL,'[\"PhD student\"]','gata-any@hotmail.com',NULL,'Bioquímica y Biología Molecular ','AGR-0258','Facultad de Farmacia ','Aprender todo lo relacionado con la investigación. ',NULL,NULL,NULL,NULL,NULL,NULL),(11,'2017-09-21 16:59:56',NULL,1,'Alberto Renato ','Inca Torres ',NULL,'[\"PhD student\"]','creny_11@hotmail.com',NULL,'Bioquimica y Biología Molecular ','AGR - 0258','Facultad de Farmacia ','Incrementar mis conocimientos en todo el área investigativa ',NULL,NULL,NULL,NULL,NULL,NULL),(12,'2017-09-22 07:54:12',NULL,1,'XI','DANG',NULL,'[\"PhD student\"]','dancer0906@gmail.com',NULL,'Cirugía ','Análisis observacional para evaluar la eficacia y seguridad de los mTORi en la esfera oncológica en el paciente trasplantado hepaático','Universo de Sevilla (Hospital Virgen del Rocío, IBIS)','',NULL,NULL,NULL,NULL,NULL,NULL),(13,'2017-09-22 08:02:42',NULL,1,'Emilia','Naranjo Fernández',NULL,'[\"PhD student\"]','eminaranjo@us.es',NULL,'Microbiología y Parasitología','BIO320 Biostabilizadores de Origen Microbiano. Joaquín J. Nieto','Facultad de Farmacia','Este curso me completa mis estudios de doctorado',NULL,NULL,NULL,NULL,NULL,NULL),(14,'2017-09-22 08:02:05',NULL,1,'Rosa María','García Valero',NULL,'[\"PhD student\"]','rgarcia5@us.es',NULL,'Microbiología y Parasitología','Grupo PAIDI: BIO320 (Joaquín Nieto)','Universidad de Sevilla','Creo que este curso encaja por completo en mi formación como doctoranda.',NULL,NULL,NULL,NULL,NULL,NULL),(15,'2017-09-22 08:02:25',NULL,1,'Lourdes','Martinez',NULL,'[\"PhD student\"]','loumarmar91@gmail.com',NULL,'Microbiología y Parasitología','BIO320 (Joaquín J. Nieto Gutiérrez)','Facultad de Farmacia. Universidad de Sevilla','Este curso me dotará nuevos conocimientos para la realización de mi doctorado y competencias para el ámbito investigador.',NULL,NULL,NULL,NULL,NULL,NULL),(16,'2017-09-22 08:09:38',NULL,1,'Cristina','Sanchez-Porro',NULL,'[\"PhD student\",\"PI\"]','sanpor@us.es',NULL,'Microbiología y Parasitología','Microorganismos halófilos (BIO213)','Facultad de Farmacia','',NULL,NULL,NULL,NULL,NULL,NULL),(17,'2017-09-22 08:18:24',NULL,1,'Christian','Rosales Barrios',NULL,'[\"PhD student\"]','christianrosalesbarrios@gmail.com',NULL,'Química Orgánica y Biológica','Síntesis asimétrica y nanosistemas funcionales','Instituto de Investigaciones Químicas (cicCartuja)','',NULL,NULL,NULL,NULL,NULL,NULL),(18,'2017-09-22 08:17:27',NULL,1,'Elena','Romero Ben',NULL,'[\"PhD student\"]','eleromben@gmail.com',NULL,'Química Orgánica y Biológica','Síntesis asimétrica y Nanosistemas Funcionales','Instituto de Investigaciones Química Isla de la Cartuja. CSIC','',NULL,NULL,NULL,NULL,NULL,NULL),(19,'2017-09-22 08:30:20',NULL,1,'Rocío','Martínez de Pablos',NULL,'[\"PhD student\",\"PI\"]','depablos@us.es',NULL,'Bioquímica y Biología Molecular','Bio113 (José Luis Venero y Rocío Martínez)','Facultad de Farmacia','Me gustaría trasladar al resto del grupo la información recibida en el workshop, ya que trabajamos con muchos animales con procedimientos a veces moderados/severos',NULL,NULL,NULL,NULL,NULL,NULL),(20,'2017-09-22 08:33:53',NULL,1,'DIEGO','RUANO CABALLERO',NULL,'[\"PI\"]','ruano@us.es',NULL,'Bioquímica y Biología Molecular','Diego Ruano','Instituto de Biomedicina de Sevilla','',NULL,NULL,NULL,NULL,NULL,NULL),(21,'2017-09-22 09:14:54',NULL,1,'María','Ortego Domínguez',NULL,'[\"PhD student\"]','modguez_92@hotmail.com',NULL,'Fisiología Médica y Biofísica','Biofísica Celular','Facultad de Medicina','Interés por conocer más acerca de los límites éticos de la investigación (ya sea en humanos como en animales), así como la metodología y organismos encargados de dicha ética. ',NULL,NULL,NULL,NULL,NULL,NULL),(22,'2017-09-22 09:27:33',NULL,1,'Clara','Muñoz Castro',NULL,'[\"PhD student\"]','claramc19@gmail.com',NULL,'Departamento de Bioquímica y Biología Molecular.','Javier Vitorica',' Facultad de Farmacia.','Considero la Ética un aspecto esencial en nuestras vidas, y por lo tanto, debe considerarse en toda investigación científica. Teniendo en cuenta la existencia de diversos dilemas éticos en el ámbito de las ciencias, asistir a un workshop sobre este tema puede ser de gran utilidad en el día a día de cualquier investigador y contribuir, en consecuencia, a una adecuada formación de los doctorandos.\r\n',NULL,NULL,NULL,NULL,NULL,NULL),(23,'2017-09-22 08:37:34',NULL,1,'María Pilar','Puerto Camacho',NULL,'[\"PhD student\"]','mpilarpuertocamacho@gmail.com',NULL,'Oncohematology and Genetic Area','Molecular Pathology of Sarcoma and other ','Instituto de Biomedicina de Sevilla (IBiS)','Currently, scientific misconduct is appearing more freqquently than expected in the news. This scary situation must be struggled by ethical education to the scientific community. As a second-year PhD student, attending this workshop would be of great value.for my oersonal scientific career ',NULL,NULL,NULL,NULL,NULL,NULL),(24,'2017-09-22 09:27:03',NULL,1,'MARIA VIRTUDES','SANCHEZ MICO',NULL,'[\"PhD student\"]','marsanmic@gmail.com',NULL,'Departamento de Bioquímica y Biología Molecular','Javier Vitorica','Facultad de Farmacia','La asistencia a este workshop sería muy útil en mi carrera investigadora, debido a la carencia de este tipo de cursos y enseñanzas, en general. Hoy en día, es muy importante que los investigadores tengan buenas conductas en la investigación, y conozcan los límites éticos y las buenas prácticas necesarias a la hora de trabajar en un laboratorio de investigación, y esta enseñanza no se nos ha transmitido a los doctorandos en ningún momento en nuestra educación hasta ahora, con lo que considero que esta es la mejor oportunidad, pudiendo aprender de investigadores y especialistas con gran experiencia en este aspecto. ',NULL,NULL,NULL,NULL,NULL,NULL),(25,'2017-09-22 09:16:02',NULL,1,'MARÍA DEL CARMEN','NARANJO GUTIÉRREZ',NULL,'[\"PhD student\"]','cnaranjo@us.es',NULL,'Bioquímica Médica y Biología Molecular e Inmunología','Neuroendocrinología Molecular (PAI-CTS 0160) ','Facultad de Medicina / Instituto de Biomedicina de Sevilla-IBIS','Los temas que se tratarán en esta jornada redundan directamente en mi formación como investigadora, ampliando y actualizando mis conocimientos sobre la ética y las buenas prácticas en la investigación.',NULL,NULL,NULL,NULL,NULL,NULL),(26,'2017-09-22 09:35:02',NULL,1,'Helena','Domínguez Martín',NULL,'[\"PhD student\"]','hdominguez-ibis@us.es',NULL,'Bioquímica y Biología Molecular','Javier Vitorica','Facultad de Farmacia','Al estar trabajando en investigación científica aplicada a la biomedicina, con modelos animales en rata y ratón, creo que es de suma importancia tener claros los límites y valores éticos y morales en los cuales debemos basarnos a la hora de tomar ciertas decisiones.\r\nEs algo que, si se trata durante la formación universitaria, suele ser someramente, y es de esperar que el estudiante tenga ya una integridad moral de base; pero al enfrentarte al día a día de la investigación con animales se echan en falta ciertas pautas y consejos que deben continuar recordándose a lo largo de la carrera investigadora.\r\nEs por ello que me resulta de sumo interés este curso, el cual considero necesario e indispensable para todo aquel que trabaje en este tipo de campos.',NULL,NULL,NULL,NULL,NULL,NULL),(27,'2017-09-22 09:56:57',NULL,1,'Helena','García Moreno',NULL,'[\"PhD student\"]','helgarmor@alum.us.es',NULL,'Bioquimica Médica y Biología Molecular e Inmunología ','Neuroendocrinología Molecular (PAI-CTS 0160)','Facultad de Medicina ','Creo que la ética en todos los ámbitos de la vida es importante y mucho más si hablamos de investigación. Puesto que los trabajos de investigación suelen estar cercanos a los límites de la ética así como estar más adelantados a las corrientes de pensamientos de la sociedad, es por ello interesante conocer esta materia con toda la profundidad posible. ',NULL,NULL,NULL,NULL,NULL,NULL),(28,'2017-09-22 10:12:04',NULL,1,'Ana','Durán Viseras',NULL,'[\"PhD student\"]','anaduran@us.es',NULL,'Microbiología y Parasitología','Microorganismos Halófilos','Facultad de Farmacia','',NULL,NULL,NULL,NULL,NULL,NULL),(29,'2017-09-22 10:20:40',NULL,1,'OLGA','RODRÍGUEZ-GALÁN ',NULL,'[\"PhD student\",\"Postdoc\"]','olgarg@us.es',NULL,'GENETICA','JESÚS DE LA CRUZ DÍAZ','INSTITUTO DE BIOMEDICINA DE SEVILLA','ENCUENTRO ESTAS JORNADAS SOBRE ÉTICA EN INVESTIGACIÓN MUY INTERESANTES Y ÚTILES. CONSIDERO QUE LA COMUNIDAD CIENTÍFICA TENEMOS UNA RESPONSABILIDAD CON LA SOCIEDAD EN CUANTO A LA VERACIDAD, TRANSPARENCIA Y DIVULGACIÓN DE LOS RESULTADOS QUE OBTENEMOS EN NUESTRA INVESTIGACIÓN, ASÍ COMO DEL USO QUE HACEMOS DE LOS RECURSOS QUE DICHA SOCIEDAD NOS FACILITA.\r\nPOR TANTO, LA FORMACIÓN DE LOS INVESTIGADORES EN ÉTICA ES ESENCIAL.',NULL,NULL,NULL,NULL,NULL,NULL),(30,'2017-09-22 08:57:37',NULL,1,'Pablo','del Cerro Sánchez',NULL,'[\"PhD student\"]','pdelcerro@us.es',NULL,'Microbiología','Francisco Javier Ollero Márquez (Biotecnologia de la Interacción Planta-Microorganismo Beneficiosos)','Facultad de Biología - Universidad de Sevilla','Me parece interesante la temática del curso. En la investigación se presiona mucho a los grupos por publicar y en algunos casos, se consigue que estas personas no cumplan con los requerimientos éticos y experimentales que conlleva la investigación.',NULL,NULL,NULL,NULL,NULL,NULL),(31,'2017-09-22 10:44:57',NULL,1,'Pilar','Navarro Gómez',NULL,'[\"PhD student\"]','pnavarro2@us.es',NULL,'Microbiología','AGR162: Unidad de producción y evaluación de inoculantes para leguminosas de grano.','Facultad de biología, Universidad de Sevilla','Conocer y profundizar más en el mundo de la ciencia. Saber cual es la manera correcta de hacer las cosas para alcanzar los objetivos perseguidos .',NULL,NULL,NULL,NULL,NULL,NULL),(32,'2017-09-22 10:50:24',NULL,1,'LORENZO GABRIEL','BORREGO SANCHEZ DE LA CUESTA',NULL,'[\"PhD student\"]','gabri